function dropDown(){document.getElementById("Dropdown").classList.toggle("hide")}window.onclick=function(e){if(!e.target.matches("navbar_def_dropdown_btn")){let e,n=document.getElementsByClassName("navbar_def_dropdown_content");for(e=0;e<n.length;e++){let t=n[e];t.classList.contains("hide")&&t.classList.remove("hide")}}};